import UserContext from "../context/UserContext";
import {useHistory} from "react-router-dom";
import axios from 'axios';

export default function HomePage() {

  useEffect(() => {
    const putItems = async () => {
      const stitch = {title : "stitch", component : "stitch", svg_url : "https://res.cloudinary.com/drqctijmr/image/upload/v1606887811/22_Stay_weird_rsqaja.svg"};
      const cheshire = {title : "cheshire", component : "cheshire", svg_url : "https://res.cloudinary.com/devjzx2qq/image/upload/v1607218779/cat_zfi67x.svg"};

      const allImages = [{
        stitch,
        cheshire
      }]

      allImages.map(async(image) => {
          await axios.post(
            "http://localhost:5000/image/add", 
            image
          )
      }
      )
    }

    putItems();
  });

  return ( 
    <div className="page">Home</div>



  )
}

